import React from 'react';

const VideoTutorialPage = () => (
  <div className="bg-background text-primary-foreground min-h-screen flex flex-col items-center justify-center">
    <h1 className="text-4xl font-bold mb-4">Video Tutorial</h1>
    <p className="text-lg">This is the content of the Video Tutorial.</p>
  </div>
);

export default VideoTutorialPage;
